import React from "react";
import "./style.css";

function Project (props) {
  return 
  <div>
    <li className="card">

      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong> {props.name}
          </li>
          <li>
            <strong>Occupation:</strong> {props.occupation}
          </li>
          <li>
            <strong>Employee ID:</strong> {props.id}
          </li>
        </ul>
      </div>  
    </li>
    </div>
}

export default Project;
